import React from "react";
import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";

export class Main extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="row">
        <div className="col-lg-8">
          <div className="row">
            <div className="col-lg-12">helooooooooooooooooooooooo</div>
          </div>
        </div>
        <div className="col-lg-4">hey dog</div>
      </div>
    );
  }
}
